import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';

function Usuarios() {
    
    return(

        <table className="mx-auto w-75 mt-5 table table-hover table-striped table-dark">
            <thead>
                <tr>
                    <th>Id</th>
                    <th>Name</th>
                    <th>Username</th>
                    <th>City</th>
                    <th>Zipcode</th>
                    <th>Phone</th>
                    <th>Company name</th>
                    <th>Ubication</th>
                </tr>
            </thead>
            <tbody>

            </tbody>
        </table>

    );
}

export default Usuarios;
